import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import App from 'app'

const HomeContainer = styled(motion.div)`
  padding: 2rem;
  text-align: center;
`;

const Home = () => (
  <HomeContainer
    initial={{ opacity: 0 }}
    animate={{ opacity: 1 }}
    transition={{ duration: 1 }}
  >
    <h2>Bem-vindo à Pousada Pinheira</h2>
    <p>
      Localizada na bela Praia de Cima, oferecemos conforto e tranquilidade para suas férias.
    </p>
    <Link to="/about">Saiba mais sobre nós</Link>
  </HomeContainer>
);

export default Home;
